import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="navbar">
      <ul>
        <li>One</li>
        <li>Two</li>
        <li>Three</li>
        <li>For</li>
      </ul>
    </div>
  );
}

export default App;
